                const decodedToken = jwtDecode(token);
                const user_id = decodedToken.unique_name;
                setUserId(user_id);
                console.log(userId)

              }
          try {
            const response = await axios.get(`https://localhost:7186/api/user/${userId}`);
            const response2 = await axios.get(`https://localhost:7186/api/Transfers/user/${name}/transfer`);
            const response3 = await axios.get(`https://localhost:7186/api/Transfers/user/${name}/receive`);
            setTransactions(response.data);
            setTransfer(response2.data);
            setReceive(response3.data)
          } catch (error) {
            console.error('Error fetching transactions:', error);
          }
        };
    
        fetchTransactions();
      }, [userId]);

      const getName = async () => {
        const username =  await axios.get(`https://localhost:7186/api/Users/${userId}`)
        setName(username.data);
        console.log(name)
      }

    
      return (
        <div>
          <div>
